// Variabel global
let sigPads = {};
let messageTimeout;

// Base64 Logo - GANTI DENGAN BASE64 LOGO ANDA
const logoBase64 =
  "data:image/jpeg;base64,";

// Daftar field yang wajib diisi (hanya data Karyawan)
const REQUIRED_FIELDS = [
  { id: "nama", label: "Nama", group: "input" },
  { id: "nik", label: "NIK", group: "input" },
  { id: "departemen", label: "Departemen", group: "input" },
  { id: "jabatan", label: "Jabatan", group: "input" },
  { id: "tanggal_mulai", label: "Tanggal Izin Mulai", group: "input" },
  { id: "tanggal_selesai", label: "Tanggal Izin Selesai", group: "input" },
  { id: "alamat", label: "Alamat", group: "textarea" },
  { id: "no_telp", label: "No. Telp", group: "input" },
  { id: "jenis_izin", label: "Jenis Permohonan Izin", group: "radio" },
  {
    id: "signature_data_karyawan",
    label: "Tanda Tangan Karyawan",
    group: "signature",
  },
];

// Fungsi utilitas untuk menampilkan pesan
function showMessage(message, type = "info") {
  clearTimeout(messageTimeout);

  const MESSAGE_BOX = document.getElementById("message-box");
  MESSAGE_BOX.className =
    "mt-4 p-3 rounded-lg text-sm flex justify-between items-center transition duration-300";

  let bgColor, textColor, iconClass;

  if (type === "error") {
    bgColor = "bg-red-100";
    textColor = "text-red-800";
    iconClass = "ph-x-circle";
  } else if (type === "success") {
    bgColor = "bg-green-100";
    textColor = "text-green-800";
    iconClass = "ph-check-circle";
  } else {
    // info / loading
    bgColor = "bg-blue-100";
    textColor = "text-blue-800";
    iconClass = "ph-info";
  }

  MESSAGE_BOX.classList.add(bgColor, textColor);

  // Sisipkan konten termasuk tombol tutup
  MESSAGE_BOX.innerHTML = `
        <div class="flex items-center font-semibold">
            <i class="ph ${iconClass} text-lg mr-2"></i>
            <span>${message}</span>
        </div>
        <button id="close-message-btn" class="ml-4 p-1 rounded-full hover:bg-opacity-50 transition opacity-80 hover:opacity-100">
            <i class="ph ph-x text-xl"></i>
        </button>
    `;

  MESSAGE_BOX.classList.remove("hidden");

  // Tambahkan event listener untuk tombol tutup
  document.getElementById("close-message-btn").onclick = () => {
    MESSAGE_BOX.classList.add("hidden");
    clearTimeout(messageTimeout);
  };

  // Set auto-hide timeout (hanya jika bukan pesan loading)
  if (type !== "loading") {
    messageTimeout = setTimeout(() => {
      MESSAGE_BOX.classList.add("hidden");
    }, 8000);
  }
}

// Fungsi untuk menghitung selisih hari
function getDayDifference(date1, date2) {
  const oneDay = 24 * 60 * 60 * 1000;
  const firstDate = new Date(date1);
  const secondDate = new Date(date2);

  const diffDays = Math.round(Math.abs((firstDate - secondDate) / oneDay)) + 1;
  return isNaN(diffDays) || diffDays <= 0 ? 0 : diffDays;
}

// --- VALIDASI KUSTOM UNTUK PESAN BOLD INLINE ---
function clearValidationErrors() {
  document.querySelectorAll(".validation-error").forEach((el) => el.remove());
  document
    .querySelectorAll(".input-error")
    .forEach((el) => el.classList.remove("input-error"));
}

function validateForm() {
  clearValidationErrors();
  let isValid = true;

  let fieldsToValidate = [...REQUIRED_FIELDS];
  const isLainLainSelected =
    document.querySelector('input[name="jenis_izin"]:checked')?.value ===
    "Lain-Lain";
  if (isLainLainSelected) {
    fieldsToValidate.push({
      id: "alasan_lain",
      label: "Alasan Lain-Lain",
      group: "textarea",
    });
  }

  for (const field of fieldsToValidate) {
    let value;
    let element;
    let errorContainer;
    let isRequired = true;

    if (field.group === "radio") {
      const checkedRadio = document.querySelector(
        `input[name="${field.id}"]:checked`
      );
      value = checkedRadio ? checkedRadio.value : "";
      errorContainer = document.getElementById("jenis-izin-heading");
    } else if (field.group === "signature") {
      value = document.getElementById(field.id).value.trim();
      element = document.getElementById("signature-canvas-karyawan");
      errorContainer = element.closest(
        ".signature-canvas-container"
      ).parentNode;
    } else {
      element = document.getElementById(field.id);
      value = element ? element.value.trim() : "";
      errorContainer = element
        ? element.closest(".flex.flex-col, .md\\:col-span-2")
        : null;
    }

    if (isRequired && !value) {
      isValid = false;
      const errorMsg = document.createElement("p");
      errorMsg.className = "validation-error";
      errorMsg.textContent = "Kolom ini wajib diisi!";

      if (field.group === "radio" && errorContainer) {
        const existingError =
          errorContainer.parentNode.querySelector(".radio-error-msg");
        if (!existingError) {
          errorMsg.classList.add("radio-error-msg", "mt-1", "mb-4");
          errorContainer.parentNode.insertBefore(
            errorMsg,
            errorContainer.nextSibling
          );
        }
      } else if (field.group === "signature" && errorContainer) {
        errorMsg.classList.add("mt-1");
        errorContainer.appendChild(errorMsg);
        element.classList.add("input-error");
      } else if (errorContainer) {
        errorContainer.appendChild(errorMsg);
        element.classList.add("input-error");
      }
    }
  }

  if (!isValid) {
    const firstError = document.querySelector(".validation-error");
    if (firstError) {
      firstError.scrollIntoView({ behavior: "smooth", block: "center" });
    }
  }

  return isValid;
}

// --- Logika Kanvas Tanda Tangan (Reusable Function) ---
function initSignaturePad(canvasId, inputId, clearButtonId) {
  const CANVAS = document.getElementById(canvasId);
  const INPUT = document.getElementById(inputId);
  const CLEAR_BUTTON = document.getElementById(clearButtonId);
  const CTX = CANVAS.getContext("2d");

  let isDrawing = false;
  let lastX = 0;
  let lastY = 0;

  function setupCanvas() {
    CTX.strokeStyle = "#000000";
    CTX.lineWidth = 3;
    CTX.lineJoin = "round";
    CTX.lineCap = "round";
    CTX.fillStyle = "white";
    CTX.fillRect(0, 0, CANVAS.width, CANVAS.height);
  }
  setupCanvas();

  function clearSignature() {
    setupCanvas();
    INPUT.value = "";
    if (canvasId === "signature-canvas-karyawan") {
      clearValidationErrors();
    }
  }

  function draw(e) {
    if (!isDrawing) return;

    let clientX, clientY;
    if (e.touches && e.touches.length > 0) {
      clientX = e.touches[0].clientX;
      clientY = e.touches[0].clientY;
    } else {
      clientX = e.clientX;
      clientY = e.clientY;
    }

    const rect = CANVAS.getBoundingClientRect();
    let x = clientX - rect.left;
    let y = clientY - rect.top;

    CTX.beginPath();
    CTX.moveTo(lastX, lastY);
    CTX.lineTo(x, y);
    CTX.stroke();

    lastX = x;
    lastY = y;
  }

  function startDrawing(e) {
    isDrawing = true;

    let clientX, clientY;
    if (e.touches && e.touches.length > 0) {
      clientX = e.touches[0].clientX;
      clientY = e.touches[0].clientY;
    } else {
      clientX = e.clientX;
      clientY = e.clientY;
    }

    const rect = CANVAS.getBoundingClientRect();
    lastX = clientX - rect.left;
    lastY = clientY - rect.top;

    if (e.type === "touchstart") {
      e.preventDefault();
    }
  }

  function stopDrawing() {
    if (!isDrawing) return;
    isDrawing = false;

    INPUT.value = CANVAS.toDataURL("image/png");

    if (canvasId === "signature-canvas-karyawan") {
      clearValidationErrors();
    }
  }

  // Event Listeners
  CANVAS.addEventListener("mousedown", startDrawing);
  CANVAS.addEventListener("mousemove", draw);
  CANVAS.addEventListener("mouseup", stopDrawing);
  CANVAS.addEventListener("mouseout", stopDrawing);

  CANVAS.addEventListener("touchstart", startDrawing);
  CANVAS.addEventListener("touchmove", draw);
  CANVAS.addEventListener("touchend", stopDrawing);

  CLEAR_BUTTON.addEventListener("click", clearSignature);

  return {
    clear: clearSignature,
    canvasElement: CANVAS,
    inputElement: INPUT,
    clearButtonElement: CLEAR_BUTTON,
  };
}

function initCanvasListeners() {
  sigPads.karyawan = initSignaturePad(
    "signature-canvas-karyawan",
    "signature_data_karyawan",
    "clear-signature-karyawan"
  );
  sigPads.management = initSignaturePad(
    "signature-canvas-management",
    "signature_data_management",
    "clear-signature-management"
  );
  sigPads.atasan = initSignaturePad(
    "signature-canvas-atasan",
    "signature_data_atasan",
    "clear-signature-atasan"
  );
}

// --- Logika Unduh Formulir sebagai JPEG (DENGAN TEMPLATE TERPISAH) ---
async function downloadFormAsImage() {
  // Validasi form sebelum download
  if (!validateForm()) {
    showMessage(
      "Tidak bisa mengunduh formulir. Harap isi semua kolom wajib (*) terlebih dahulu, termasuk Tanda Tangan Karyawan.",
      "error"
    );
    return;
  }

  // Ambil template download
  const template = document.getElementById("download-template");

  // Isi data dari form ke template
  fillDownloadTemplate();

  // Tampilkan template dan sembunyikan elemen yang tidak perlu
  template.style.display = "block";

  showMessage("Memproses formulir menjadi gambar JPEG...", "loading");

  try {
    // Menggunakan opsi html2canvas yang lebih spesifik untuk menghindari masalah CORS
    const canvas = await html2canvas(template, {
      scale: 3, // Kualitas tinggi
      useCORS: false, // Nonaktifkan CORS karena kita menggunakan base64
      allowTaint: false, // Tidak mengizinkan tainted canvas
      backgroundColor: "#ffffff",
      logging: false, // Nonaktifkan logging untuk performa
      imageTimeout: 15000, // Timeout yang lebih panjang untuk gambar
      removeContainer: true, // Hapus container sementara setelah selesai
      onclone: function (clonedDoc) {
        // Pastikan logo base64 sudah dimuat di dokumen yang dikloning
        const watermarkLogo = clonedDoc.getElementById("watermark-logo");
        const kopLogo = clonedDoc.getElementById("kop-logo");

        if (watermarkLogo && logoBase64) {
          watermarkLogo.src = logoBase64;
        }
        if (kopLogo && logoBase64) {
          kopLogo.src = logoBase64;
        }
      },
    });

    const imageURL = canvas.toDataURL("image/jpeg", 0.95);

    const a = document.createElement("a");
    a.href = imageURL;
    const nikKaryawan = document.getElementById("nik").value || "NIK_Kosong";
    const tanggalIzin =
      document.getElementById("tanggal_mulai").value ||
      new Date().toISOString().slice(0, 10);

    a.download = `Form_Izin_${nikKaryawan}_${tanggalIzin}.jpeg`;

    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);

    showMessage("Formulir berhasil diunduh sebagai JPEG!", "success");
  } catch (error) {
    console.error("Gagal mengunduh gambar:", error);
    showMessage(
      "Gagal membuat gambar formulir. Error: " + error.message,
      "error"
    );
  } finally {
    // Sembunyikan kembali template
    template.style.display = "none";
  }
}

// Fungsi untuk mengisi template dengan data dari form
function fillDownloadTemplate() {
  // Data Karyawan
  document.getElementById("dt-nama").textContent =
    document.getElementById("nama").value || "-";
  document.getElementById("dt-nik").textContent =
    document.getElementById("nik").value || "-";
  document.getElementById("dt-departemen").textContent =
    document.getElementById("departemen").value || "-";
  document.getElementById("dt-jabatan").textContent =
    document.getElementById("jabatan").value || "-";

  // Tampilkan nama di bawah tanda tangan
  document.getElementById("dt-nama-karyawan").textContent =
    document.getElementById("nama").value || "-";

  // Jenis Izin
  const selectedJenisIzin = document.querySelector(
    'input[name="jenis_izin"]:checked'
  );
  const jenisIzinValue = selectedJenisIzin ? selectedJenisIzin.value : "-";
  document.getElementById("dt-jenis-izin").textContent = jenisIzinValue;

  // Alasan Lain-Lain (jika dipilih)
  const isLainLain = jenisIzinValue === "Lain-Lain";
  const alasanLainContainer = document.getElementById(
    "dt-alasan-lain-container"
  );
  if (isLainLain) {
    alasanLainContainer.style.display = "block";
    document.getElementById("dt-alasan-lain").textContent =
      document.getElementById("alasan_lain").value || "-";
  } else {
    alasanLainContainer.style.display = "none";
  }

  // Durasi Izin
  document.getElementById("dt-tanggal-mulai").textContent =
    document.getElementById("tanggal_mulai").value || "-";
  document.getElementById("dt-tanggal-selesai").textContent =
    document.getElementById("tanggal_selesai").value || "-";
  document.getElementById("dt-lama-izin").textContent =
    document.getElementById("lama_izin").value || "0";

  // Pengganti & Kontak
  document.getElementById("dt-pengganti-nama").textContent =
    document.getElementById("pengganti_nama").value || "-";
  document.getElementById("dt-pengganti-jabatan").textContent =
    document.getElementById("pengganti_jabatan").value || "-";
  document.getElementById("dt-alamat").textContent =
    document.getElementById("alamat").value || "-";
  document.getElementById("dt-no-telp").textContent =
    document.getElementById("no_telp").value || "-";

  // Tanda Tangan - Gunakan placeholder SVG untuk menghindari masalah CORS
  const sigKaryawan = document.getElementById("signature_data_karyawan").value;
  const sigManagement = document.getElementById(
    "signature_data_management"
  ).value;
  const sigAtasan = document.getElementById("signature_data_atasan").value;

  // Fungsi untuk membuat placeholder SVG untuk tanda tangan
  function createSignaturePlaceholder(text) {
    return `data:image/svg+xml;base64,${btoa(`
            <svg width="200" height="120" xmlns="http://www.w3.org/2000/svg">
                <rect width="100%" height="100%" fill="#f0f0f0"/>
                <text x="50%" y="50%" text-anchor="middle" dominant-baseline="middle" 
                      font-family="Arial, sans-serif" font-size="14" fill="#888">${text}</text>
            </svg>
        `)}`;
  }

  document.getElementById("dt-signature-karyawan").src =
    sigKaryawan || createSignaturePlaceholder("Tanda Tangan Kosong");
  document.getElementById("dt-signature-management").src =
    sigManagement || createSignaturePlaceholder("Belum Disetujui");
  document.getElementById("dt-signature-atasan").src =
    sigAtasan || createSignaturePlaceholder("Belum Diketahui");

  // Set logo base64
  const watermarkLogo = document.getElementById("watermark-logo");
  const kopLogo = document.getElementById("kop-logo");

  if (
    watermarkLogo &&
    logoBase64 &&
    logoBase64 !==
      "data:image/jpeg;base64,"
  ) {
    watermarkLogo.src = logoBase64;
  }
  if (
    kopLogo &&
    logoBase64 &&
    logoBase64 !==
      "data:image/jpeg;base64,"
  ) {
    kopLogo.src = logoBase64;
  } else if (kopLogo && !kopLogo.src) {
    kopLogo.src = "logo everest1.png";
  }

  // Timestamp
  const now = new Date();
  document.getElementById("dt-timestamp").textContent = now.toLocaleString(
    "id-ID",
    {
      day: "2-digit",
      month: "2-digit",
      year: "numeric",
      hour: "2-digit",
      minute: "2-digit",
    }
  );
}

// --- Logika Kondisional & Hitung Hari ---

function setMinDateForLeave() {
  const today = new Date();
  const year = today.getFullYear();
  const month = String(today.getMonth() + 1).padStart(2, "0");
  const day = String(today.getDate()).padStart(2, "0");
  const todayISO = `${year}-${month}-${day}`;

  document.getElementById("tanggal_mulai").min = todayISO;
  document.getElementById("tanggal_selesai").min = todayISO;
}

function toggleLainLainInput() {
  const selectedRadio = document.querySelector(
    'input[name="jenis_izin"]:checked'
  );
  if (selectedRadio && selectedRadio.value === "Lain-Lain") {
    document.getElementById("lain-lain-container").classList.remove("hidden");
  } else {
    document.getElementById("lain-lain-container").classList.add("hidden");
    document.getElementById("alasan_lain").value = "";
  }
  clearValidationErrors();
}

function updateLamaIzin() {
  const start = document.getElementById("tanggal_mulai").value;
  const end = document.getElementById("tanggal_selesai").value;
  const lamaIzinInput = document.getElementById("lama_izin");

  if (start && end) {
    const diff = getDayDifference(start, end);
    lamaIzinInput.value = diff;
  } else {
    lamaIzinInput.value = "";
  }
}

// --- Inisialisasi Utama ---
document.addEventListener("DOMContentLoaded", function () {
  // Setup event listeners
  document
    .getElementById("download-button")
    .addEventListener("click", downloadFormAsImage);

  document
    .getElementById("tanggal_mulai")
    .addEventListener("change", updateLamaIzin);
  document
    .getElementById("tanggal_selesai")
    .addEventListener("change", updateLamaIzin);

  document
    .getElementById("jenis-izin-options")
    .addEventListener("change", toggleLainLainInput);

  // Inisialisasi canvas tanda tangan
  initCanvasListeners();

  // Set tanggal minimal
  setMinDateForLeave();

  // Toggle input lain-lain
  toggleLainLainInput();

  // Setup tombol submit (tanpa Firebase untuk sekarang)
  const SUBMIT_BUTTON = document.getElementById("submit-button");
  const SUBMIT_TEXT = document.getElementById("submit-text");

  SUBMIT_BUTTON.addEventListener("click", function () {
    if (!validateForm()) {
      showMessage(
        "Ada kolom wajib (*) yang belum diisi. Harap lengkapi semua data dan tanda tangan.",
        "error"
      );
      return;
    }

    showMessage(
      "Fitur penyimpanan ke database sedang dalam pengembangan. Silakan gunakan tombol download untuk menyimpan formulir.",
      "info"
    );
  });

  SUBMIT_BUTTON.disabled = false;
  SUBMIT_TEXT.textContent = "Ajukan & Simpan Permohonan Izin";
});
